import React, { Component } from 'react';

const d3 = window.d3;

export default class D3Test extends Component{

    componentDidMount(){
        d3.select(".container")
        .selectAll("p")
        .data([4, 8, 15, 16, 23, 42])
        .enter().append("p")
          .text(function(d) { return "I’m number " + d + "!"; });

    }

    render(){
        return(
            <div className='container' style={{width: 800, height: 800, background: '#fff'}}>

            </div>
        )
    }
}
